INSERT INTO `resumes` VALUES (18, 12, '22JIANLI-00395应届生计算机应用专业求职简历', NULL, '22JIANLI-00395应届生计算机应用专业求职简历.pdf', 'C:\\Users\\Jia\\Desktop\\软件杯后端\\uploads\\12\\1753217715109_22JIANLI-00395.pdf', 'pdf', 209773, NULL, '--- 第1页 ---\n刘小易\n求职意向：计算机应用技术应届生\n出生年月：2000.6.3 手机号码：15300000000\n现居地：广东 邮箱：123456@xx.com\n教育背景\n2017.09—2021.06 xxx大学 计算机应用技术（本科）\n主修课程：计算机网络、数据结构、操作系统、C语言、Dreamweaver、JAVA、DELPHI、ASP、汇编语\n言与接口技术、网络安全、网络综合布线、网页设计和网站建设等。\n实践经历\n20xx.xx—20xx.xx xxx有限公司 产品工程（实习生）\n1. 协助工程师完成产品设计和开发工作，以及样品的加工制作；\n2. 配合工程师完成设备测试调试工作，完成研发相关技术文件的编制和归档；\n3. 负责研发项目采购跟踪，库存整理，工具保管；\n4. 对其他部门的技术支持和沟通，完成领导交办其它工作内容。\n20xx.xx—20xx.xx 学校学生会（外联部） 部长\n1. 在主席团的领导下开展各类活动，全面负责学校学生会的对外交流联络工作；\n2. 组织各类商业赞助活动，为学生会活动提供经费；\n3. 向外展示学校学生的真我风采,努力提高我校学生会在社会上的知名度；\n4. 积极开展各项活动服务于同学,用行动来阐释外联部的宗旨等工作。\n个人技能\n专业技能：英语CET-4，普通话二甲等证书，计算机三级证书，初级工程师证\n其他技能：熟悉运用proe、cad，以及wps，office等办公软件\n自我评价\n个人方面：性格乐观开朗，为人陈恳，乐于助人，待人真诚，善解人意，扎实基础，有较强的逻辑思维能\n力，善于分析，归纳，解决问题，对技术有浓厚兴趣，喜欢并不断学习新技术。\n工作态度：工作中认真负责，不以自我为中心，具有团队合作精神，有自制力，做事情坚持有始有终，从\n不半途而废，喜欢与人相交，并虚心向他人学习,会用100%的热情和精力投入到工作中。', NULL, 'completed', NULL, 0, 0, '2025-07-22 20:55:15', '2025-07-22 20:55:43', '{\"email\": \"123456@xx.com\", \"phone\": \"15300000000\"}', NULL, NULL, '[\"Java\", \"DELPHI\", \"ASP\", \"C语言\", \"汇编语言与接口技术\", \"网络安全\", \"网络综合布线\", \"Dreamweaver\", \"ProE\", \"CAD\", \"WPS\", \"Office\", \"计算机三级\", \"初级工程师证\"]', '[{\"title\": \"产品工程实习生\", \"description\": \"协助工程师完成产品设计和开发工作，参与设备测试调试，负责研发项目采购跟踪及技术文件编制\", \"technologies\": [], \"period\": \"20xx.xx—20xx.xx\", \"company\": \"xxx有限公司\"}, {\"title\": \"学生会外联部部长\", \"description\": \"组织商业赞助活动，负责对外交流联络，提升学生会社会知名度\", \"technologies\": [], \"period\": \"20xx.xx—20xx.xx\", \"company\": \"学校学生会\"}]', NULL, '[\"Java\", \"DELPHI\", \"ASP\", \"C语言\", \"汇编语言与接口技术\", \"网络安全\", \"网络综合布线\", \"Dreamweaver\", \"ProE\", \"CAD\", \"WPS\", \"Office\", \"计算机三级\", \"初级工程师证\"]', '[\"Java开发工程师\", \"软件工程师\", \"技术支持工程师\"]', '{\"skills\": [\"Java\", \"DELPHI\", \"ASP\", \"C语言\", \"汇编语言与接口技术\", \"网络安全\", \"网络综合布线\", \"Dreamweaver\", \"ProE\", \"CAD\", \"WPS\", \"Office\", \"计算机三级\", \"初级工程师证\"], \"projects\": [{\"title\": \"产品工程实习生\", \"description\": \"协助工程师完成产品设计和开发工作，参与设备测试调试，负责研发项目采购跟踪及技术文件编制\", \"technologies\": [], \"period\": \"20xx.xx—20xx.xx\", \"company\": \"xxx有限公司\"}, {\"title\": \"学生会外联部部长\", \"description\": \"组织商业赞助活动，负责对外交流联络，提升学生会社会知名度\", \"technologies\": [], \"period\": \"20xx.xx—20xx.xx\", \"company\": \"学校学生会\"}], \"positions\": [\"Java开发工程师\", \"软件工程师\", \"技术支持工程师\"], \"experience_years\": 0.5, \"strengths\": \"掌握Java、DELPHI、ASP等开发技术，熟悉网络综合布线及安全技术；具备产品工程实习经验，熟悉研发流程管理；拥有初级工程师资质，逻辑思维能力强，擅长团队协作与技术学习。\"}');

-- ----------------------------
-- Table structure for system_config
